import React, { PropTypes } from 'react';

function FacebookSharePost(props) {
  let personalityTypeSize = 350;
  if (props.personalityType.length > 4) {
    personalityTypeSize = personalityTypeSize * (1 - (0.045 * (props.personalityType.length - 4)));
  }
  let personalityTypeStyles = {
    fontSize: personalityTypeSize + "px",
    fill: "#fffefe",
    fontFamily: "'Trump Gothic Pro', sans-serif",
    fontWeight: 700,
    textTransform: "uppercase"
  };

  return (
    <svg xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" height="650" width="1200"
         viewBox="0 0 1200 650"
         id={props.selector}>
      <defs>
        <style type="text/css">
          {`@font-face {
          font-family: 'Open Sans';
          font-style: normal;
          font-weight: 400;
          src: local('Open Sans'), local('OpenSans'), url(data:application/x-font-woff;base64,) format('woff');
        }`}
        </style>
      </defs>
      <rect id="bg" height="650" width="1200" style={{ fill: "#000111" }}/>
      <image id="backgroundImage" data-name="backgroundImage" style={{ opacity: 0.30 }} x="-618" y="-932" width="2468"
             height="2468"
             xlinkHref="data:img/png;base64,"/>
      <text id="personalityType" style={personalityTypeStyles} x="600" y="300" textAnchor="middle"
            alignmentBaseline="central">
        {props.personalityType.toUpperCase()}
      </text>

      <text id="message" data-name="message" style={{
        textAnchor: "middle",
        fontSize: "40px", fill: "#fff", fontFamily: "Open Sans"
      }} x="600" y="100" textAnchor="middle" alignmentBaseline="central">{`${props.displayName} works like an`}
      </text>
      <rect id="actionButton" data-name="actionButton" style={{ fill: "#ff004e" }} x="260" y="490" width="700"
            height="80" rx="40" ry="40"/>
      <text id="action" data-name="action" style={{
        fill: "#fff",
        fontFamily: "Open Sans",
        fontSize: "37.078px"
      }} transform="translate(315.132 540.035) scale(0.971)">
        Learn how you work on enQounter
      </text>
    </svg>
  )
}

FacebookSharePost.propTypes = {
  personalityType: PropTypes.string.isRequired
};

export default FacebookSharePost;
